name: Pan Di Spagana Al Ciccolato (Chocolate Sponge Cake)
servings: 8
source: The Smiley Taste Blog
source_url: https://www.youtube.com/watch?v=OXKGE4r8i3Q
prep_time: 15 minutes
cook_time: 45 minutes
categories: [bakery, cake, dessert, chocolate]
ingredients: |
  200g eggs at room temperature (approx. 4 medium eggs)
  100g granulated sugar
  50g pastry flour (9% protein)
  25g unsweetened cocoa powder
  25g potato starch
  pinch of salt
directions: |
  Soak eggs in warm tap water, let sit for 5 minutes.
  Preheat oven to 170 degrees celsius (340 F)
  Line springform pan with parchment / flour
  Begin beating eggs, slowly add sugar. Beat for 20 minutes
  Sift 2x flour, cocoa powder, starch
  Add flour in several additions & slowly fold each time until completely combined.
  Pour batter into cake pan, swirling & tapping gently on counter to settle
  Bake for 40-45 minutes until firm to the touch in the middle. Do not open oven door for at least first 30 minutes
